import classes from "./Post.module.css";

const Post = (props) => {
    return (
        <div className={classes.item}>
            <img src="https://i.ytimg.com/vi/cX_cZ0kGAKo/maxresdefault.jpg" alt=""/>
            <div className={classes.postText}>
                {props.message}
            </div>
            <div>
                <span>Likes: {props.likes}</span>
            </div>
        </div>
    );
};
export default Post;
